function GetReport(cmd_class, cmd_id, size)
{
    var report = new Array(91).fill(0);

    report[0] = 0;

    // Status.
    report[1] = 0x00;

    // Transaction ID.
    report[2] = 0xFF;
    
    // Remaining packets.
    report[3] = 0x00;
    report[4] = 0x00;

    // Protocol type.
    report[5] = 0x00;

    // Data size.
    report[6] = size;

    // Command class.
    report[7] = cmd_class;

    // Command id.
    report[8] = cmd_id;

    //report[8-87] = data;

    //report[89] = crc;

    //report[89] = reserved;

    return report;
}


function CalculateCrc(report)
{
    var iCrc = 0;

    for (var iIdx = 3; iIdx < 89; iIdx++) {
        iCrc ^= report[iIdx];
    }

    return iCrc;
}


